import React from 'react'
import {Avatar, Card} from 'antd';

const UserProfile = () => {
  return (
    <Card
      actions={[
        <div key="twit">찍찍 </div>,
        <div key="followings">팔로잉 </div>,
        <div key="followings">팔로워 </div>
      ]}
    >
      <Card.Meta
        avatar={<Avatar>SH</Avatar>}
        title="SuHwan"
      />
    </Card>
  )
}

export default UserProfile
